import React from "react"
import {BrowserRouter as Router, Link, Route} from "react-router-dom"
import "./NavBar.css"
import HoverCards from "./HoverCards.js";
import ReactSearchBox from 'react-search-box'

function Navbar() {

    let pages = [
        {url: '/finditems', name: 'Find items'},
        {url:'/login', name: 'Sign Up/Log In'}]
    let data = [
        {
            key: 'john',
            value: 'John Doe',
        },
        {
            key: 'jane',
            value: 'Jane Doe',
        },
        {
            key: 'mary',
            value: 'Mary Phillips',
        },
        {
            key: 'robert',
            value: 'Robert',
        },
        {
            key: 'karius',
            value: 'Karius',
        },
    ]
    return (
        <div className='navbar'>
            <Router>
                <Link to={'/main'} className='logo' key={'Momento'}>
                    {'Momento'}
                </Link>
                {pages.map((items) =>
                    <Link to={items.url} className='link' key={items.name}>
                        {items.name}
                    </Link>
                )}
                <Route path="/main"  exact/>
                <Route path="/hoverCards" render={(props) => <HoverCards num={11} />} />
            </Router>
            <ReactSearchBox
                placeholder="Search..."
                data={data}
                callback={record => console.log(record)}
                className = 'search'
            />
        </div>
    );
}



export default Navbar
